{"operationName":"QueryKittygotchies","variables":{"owner":"0x7e4abd63a7c8314cc28d388303472353d884f292"},"query":"query QueryKittygotchies($owner: String!) {
  tokens(where: {owner_contains: $owner}) {
    id
    owner {
      id
      __typename
    }
    attack
    defense
    run
    uri
    lastUpdated
    __typename
  }
}
"}

{"operationName":"GetAllMyBalance","variables":{"address":"0x7e4ABd63A7C8314Cc28D388303472353D884f292"},"query":"query GetAllMyBalance($address: String!) {
  ethereum(network: ethereum) {
    address(address: {is: $address}) {
      balance
      balances {
        currency {
          name
          symbol
          decimals
          address
          tokenType
          __typename
        }
        value
        valueInUsd: value
        __typename
      }
      __typename
    }
    __typename
  }
  bsc: ethereum(network: bsc) {
    address(address: {is: $address}) {
      balance
      balances {
        currency {
          name
          symbol
          decimals
          address
          tokenType
          __typename
        }
        value
        valueInUsd: value
        __typename
      }
      __typename
    }
    __typename
  }
  matic: ethereum(network: matic) {
    address(address: {is: $address}) {
      balance
      balances {
        currency {
          name
          symbol
          decimals
          address
          tokenType
          __typename
        }
        value
        valueInUsd: value
        __typename
      }
      __typename
    }
    __typename
  }
}
"}
